import styled from 'styled-components';


const Container = styled("div")`
width: 100vw;
height: 100px;
background-color: #40E0D0;
display: flex;
justify-content: center;
align-items: center;

position: relative;
`
const Title = styled("h1")`
    margin: 0;
    font-family: 'Bungee', cursive;
`
const Link = styled("a")`
font-size: 1.5rem;
margin: 1rem;
cursor: pointer;
color: initial;
text-decoration: none;

position:absolute;
right: 5%;

@media (max-width: 700px) {
    position: initial;
}
`

const Navbar = () => {
    return (
        <Container>
            <Title>
                Monsters
            </Title>
            <Link href="/">
                Roadmap
            </Link>
        </Container>
    )
}
export default Navbar;
